import React from "react";
import ButtonMain from "../../components/ButtonMain/ButtonMain";
import * as colorClasses from "../../utils/colorClasses";

export default function Main() {
  let letterButtons = [];
  let buttonClasses = [
    buttonYellow,
    buttonRed,
    buttonGreen,
    buttonPurple,
    buttonChartreuse,
    buttonCyan,
    buttonMagenta,
    buttonBlue,
    buttonOrange,
  ];
  let i = 0;
  for (let letter of "ABCDEFGHIJKLMNOPQRSTUVWXYZ") {
    letterButtons.push(
      <>
        <ButtonMain buttonClass={buttonClasses[i++]}>
          Letter {letter}
        </ButtonMain>
      </>
    );
  }
  return <>{letterButtons}</>;
}
